Fix #4425: support loading local file in webview

To use this, add the following partition to manifest:

  "webview": {
    "partitions": [
      {
       "name": "trusted",
       "accessible_resources": [ "<all_urls>" ]
      }
    ]
  },

Extend Tray click event with position

- Add a parameter to the `click` event of the  `Tray` API object containing the
coordinates of the tray icon/mouse pointer.
The parameter has `x` and `y` fields for the coordinates.
On Mac OS X the coordinates always refer to the position (lower left corner) of
the tray item (NSStatusItem).
On Aura (Linux, Windows) the coordinates refer to the cursor position (which
would be inside the bounding box of the status icon but with slight differences
depending on where effectively the user clicked).

Usage example:

    tray.on('click', function(pos) {
      // pos.x is x coordinate of the tray icon
      // pos.y is y coordinate of the tray icon
      showCustomTrayMenuAt(pos);
    }

FIX rogerwang/node-webkit#1874

Option to hide "Edit" and "Window" OS X menus

This commit adds the option to hide the “Edit” and “Window” menus when
invoking `createMacBuiltin` like so:

```js
nativeMenuBar.createMacBuiltin('My App', {
  hideEdit: true,
  hideWindow: true
});
```

[API] Implement register/unregister global desktop keyboard shortcut on Winodws.

- Introduce GlobalShortcutListener;
- New api object: Shortcut({'key': '...', 'active': ..., 'failed': ...});
- New api: App.registerGlobalHotkey, App.unregisterGlobalHotkey.

support setting the value of a file input

Fix #927 . Users can do this to set the input:
var f = new File('/path/to/file', 'name');
var files = new FileList();
files.append(f);
document.getElementById('input0').files = files;

[WebKit] All pages should use node's security token;

[WebKit] node's symbols are now set as getters of "window.prototype".

Fix #33.
